import React from 'react';
import { Button, Typography, Box } from '@mui/material';

const Connect = () => {
  return (
    <Box
      display='flex'
      flexDirection='column'
      justifyContent='center'
      alignItems='center'
      minHeight='100vh'
    >
      <Typography variant='h2' fontWeight='700' gutterBottom color='#ffffff'>
        CONNECT FOR RECOMMENDATION
      </Typography>
      <Button variant='contained' color='primary' size='large'>
        Connect
      </Button>
      <Typography marginTop='100px' fontWeight='800' fontSize='40px' color='#ffffff'>
        DEVICES THAT WE SUPPORT
      </Typography>
      <Box display='flex' justifyContent='center' alignItems='center' mt={2}>
        {/* Add your images here */}
        <img src="scale.jpg" alt="Image 1" />
        <img src="1_Mi_Band_3.jpg" alt="Image 2" />
      </Box>
    </Box>
  );
}

export default Connect;
